decription:
Selling this because I'm buying a new car. It has 110681 miles on it and still runs smoothly. AWD. Had oil change regularly (about every 6 -9 monthly). There is some rust on the right rear tire fender, but got it painted. Some light scratches below the right headlight and on the top roof(bad car wash). The left rear door has a guard sticking out but doesn't actually affect anything. Here are the parts that have been changed:

1. AcDelco front wheel bearings(both side);

2. PowerStop front brake system(rotors, pads, calipers);

3. Suspension(new strouts on front and rear);

4. The whole exhaust system.

5. Tires.
